const Checkbox: React.FC = () => {

const [isChecked, setIsChecked] = useState(false);

  return (
    <label>
      <input
        type="checkbox"
        checked={isChecked}
        onChange={() => setIsChecked(!isChecked)}
        // className={`bg-${color}-500`}
      />
      <p>yosugala</p>
    </label>
  );

}

export default Checkbox;
